DROP TABLE IF EXISTS `enumeration_blocks`;
CREATE TABLE `enumeration_blocks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_number` int(11) DEFAULT NULL,
  `sub_enumeration_number` int(11) DEFAULT NULL,
  `number_of_houses` int(11) DEFAULT NULL,
  `number_of_citizens` int(11) DEFAULT NULL,
  `state_id` int(11) DEFAULT NULL,
  `division_id` int(11) DEFAULT NULL,
  `district_id` int(11) DEFAULT NULL,
  `revenue_block_id` int(11) DEFAULT NULL,
  `panchayat_id` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `catalog_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `enumeration_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `enu_nic_upload_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `supervising_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `super_nic_upload_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `draft_list_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `draft_list_edit_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `final_list_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT 'NYS',
  `report_status` tinyint(1) DEFAULT '0',
  `remarks` text COLLATE utf8_unicode_ci,
  `created_by` int(11) DEFAULT NULL,
  `modified_by` int(11) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=315 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

